import React from 'react';
import './CheckPopup.css';

const CheckPopup = ({ images, isOpen, onClose }) => {
    if (!isOpen) return null;

    return (
        <div className="check-popup-overlay">
            <div className="check-popup">
                <button className="close-btn" onClick={onClose}>x</button>
                <div className="images-grid">
                    {images.map((id, index) => (
                        <img key={index} src={`http://localhost:8000/topk_results/${id}.png`} alt={`Image ${id}`} className="popup-img" />
                    ))}
                </div>
            </div>
        </div>
    );
};

export default CheckPopup;
